import React, { Component } from 'react';


class Stock extends Component {

    constructor(){
        super()

        console.log("Hello")

    }

    render() {
      return (
        <div className="stock">

            Name is: {this.props.name}
            Amount owned is: {this.props.amount}

            <button>Sell</button>
            <button>SET_SELL_AMOUNT</button>
            <button>SET_SELL_TRIGGER</button>

        </div>
      );
    }
  }

  export default Stock;
